import { faDiscord } from '@fortawesome/free-brands-svg-icons';
import React, { forwardRef } from 'react';
// import { Link } from 'react-feather';
import Link from 'next/link';
import { useRouter } from 'next/router';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {
	faSquare,
	faFileAlt,
	faQuestionCircle,
	faNetworkWired,
	faChevronDown,
	faCircle,
	faLayerGroup,
	faBell,
} from '@fortawesome/free-solid-svg-icons';

const Header = forwardRef((props, ref: React.ForwardedRef<HTMLDivElement>) => {
	const currentHref = useRouter().pathname;
	props;
	console.log('CURRENT HREF', currentHref);

	return (
		<div
			ref={ref}
			className="w-full px-6 bg-secondary-bg flex items-center border-b-1 border-primary-border overflow-hidden"
			// style={{ height: '78px', maxHeight: '85px' }}
			style={{ height: '78px', maxHeight: '78px' }}
		>
			<div className="flex flex-col py-4">
				<Link href="/">
					<h3 className="cursor-pointer font-extrabold flex items-center">
						{/* <span className="text-primary-color">Redacted</span>Name */}
						{/* <FontAwesomeIcon
							icon={faSquare}
							className="mr-3 text-primary-color"
						/> */}
						<div className="bg-primary-color w-7 h-7 rounded-full mr-3" />
						MC-Niglets.org{' '}
						{/* <span className="font-medium uppercase text-lg ml-2">Bot</span> */}
					</h3>
				</Link>

				{/* <p className="text-secondary-text uppercase">The #1 Build Store</p> */}
			</div>
			<div className="h-full ml-8">
				<ul className="flex items-center space-x-8 h-full">
					{[
						// { display: 'Home', href: '/' },
						// {
						// 	display: 'Forums',
						// 	href: '/',
						// 	icon: <FontAwesomeIcon icon={faFileAlt} className="mr-3" />,
						// },
						{
							display: 'Resources',
							href: '/resources',
							icon: <FontAwesomeIcon icon={faLayerGroup} className="mr-3" />,
						},
						{
							display: 'Support',
							href: '/support',
							icon: (
								<FontAwesomeIcon icon={faQuestionCircle} className="mr-3" />
							),
						},
						{
							display: 'Status',
							href: '/status',
							icon: <FontAwesomeIcon icon={faNetworkWired} className="mr-3" />,
						},
					].map((link) => {
						return (
							<Link href={link.href}>
								<li className="cursor-pointer">
									{link.icon && link.icon}
									{link.display}
								</li>
							</Link>
						);
					})}
				</ul>
			</div>
			<div className="flex-1 w-fit flex items-center justify-end space-x-8">
				<ul className="flex items-center space-x-8 h-full">
					{[
						// { display: 'Home', href: '/' },
						// {
						// 	display: 'Forums',
						// 	href: '/',
						// 	icon: <FontAwesomeIcon icon={faFileAlt} className="mr-3" />,
						// },
						{
							display: '',
							href: '/alerts',
							icon: <FontAwesomeIcon icon={faBell} className="mr-3" />,
						},
						{
							display: 'Support',
							href: '/support',
							icon: (
								<FontAwesomeIcon icon={faQuestionCircle} className="mr-3" />
							),
						},
						{
							display: 'Status',
							href: '/status',
							icon: <FontAwesomeIcon icon={faNetworkWired} className="mr-3" />,
						},
					].map((link) => {
						return (
							<Link href={link.href}>
								<li className="cursor-pointer">
									{link.icon && link.icon}
									{link.display && link.display}
								</li>
							</Link>
						);
					})}
				</ul>
				<Link href="https://discord.gg/eEFcyVfFU2">
					<a
						target="_blank"
						className="py-2 px-4 flex items-center text-white rounded-md bg-primary-color"
						// style={{ backgroundColor: '#7289DA' }}
					>
						<FontAwesomeIcon icon={faDiscord} />
						<span className="ml-2">Log in via discord</span>
					</a>
				</Link>
			</div>
		</div>
	);
});

<Link href="https://discord.gg/eEFcyVfFU2">
	<a
		target="_blank"
		className="flex items-center text-white rounded-md border-1 border-secondary-border box-border"
		// style={{ borderStyle: 'inset' }}
		// style={{ backgroundColor: '#7289DA' }}
	>
		{/* <FontAwesomeIcon icon={faCircle} /> */}
		<div className="h-full bg-secondary-bg" />{' '}
		{/** <---- REMINDER fix to show avatar */}
		{/* <div className="h-full w-auto bg-secondary-bg rounded-full" /> */}
		<div className="py-2 px-4">
			<span className="ml-2">RiznSun's Bot Server</span>
			<FontAwesomeIcon
				icon={faChevronDown}
				className="ml-6 text-secondary-text"
			/>
		</div>
	</a>
</Link>;

export default Header;
